Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable.Map

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder().appName("HitRateCalculator").getOrCreate()

    // Load onsite attributed data
    val onsiteData = spark.read.format("csv").option("header", "true").load("onsite_data.csv")
      .select("query", "timestamp")
      .rdd
      .map(row => (row.getString(0), row.getLong(1)))

    // Load top frequent queries
    val topQueries = spark.read.format("csv").option("header", "true").load("top_queries.csv")
      .select("query")
      .rdd
      .map(row => row.getString(0))
      .collect()
      .toSet

    // Broadcast top queries to all nodes
    val broadcastTopQueries = spark.sparkContext.broadcast(topQueries)

    // Calculate hit rate
    val hitRate = onsiteData.mapPartitionsWithIndex((index, iterator) => {
      val cache = Map[String, Long]()
      val topQueries = broadcastTopQueries.value
      iterator.map { case (query, timestamp) =>
        if (topQueries.contains(query)) {
          if (cache.contains(query) && timestamp - cache(query) <= 12 * 60 * 60 * 1000) {
            (query, "hit")
          } else {
            cache.put(query, timestamp)
            (query, "miss")
          }
        } else {
          (query, "not_top_query")
        }
      }
    }, preservesPartitioning = true)
      .filter(tuple => tuple._2 != "not_top_query")
      .map(tuple => if (tuple._2 == "hit") 1 else 0)
      .reduce(_ + _) / hitRate.count()

    println(s"Hit rate: $hitRate")

    spark.stop()
  }
}
```
This job first loads the onsite attributed data and top frequent queries from CSV files. It then broadcasts the top frequent queries to all nodes in the cluster.

Next, it calculates the hit rate by iterating over the onsite attributed data and checking if the query is in the top frequent queries. If it is, it checks if the query is in the cache and if it was accessed within the last 12 hours. If it was, it counts as a hit, otherwise it counts as a miss. If the query is not in the top frequent queries, it is ignored.

Finally, it calculates the hit rate by dividing the number of hits by the total number of queries that were in the top frequent queries.

